import React from "react";

const GroceryItem = (props) => {
  const { row } = props;
  return (
    <tr key={row.id}>
      <td>{row.place}</td>
      <td>{row.amount}</td>
    </tr>
  );
};

const Groceries = (props) => {
  const rows = props.groceries.map((row) => {
    return <GroceryItem row={row} />;
  });
  return <tr>{rows}</tr>;
};

export default Groceries;
